const addUser = () => {
  return (
    <React.Fragment>
      <form className="container">
        <div>
          <label htmlFor='Username'>Username</label>
          <input id="Username" type="text" height="10px" width="40px"></input>
        </div>
        <div>
          <label htmlFor='Age'>Age(in years)</label>
          <input  type="number" height="10px" width="40px"></input>
        </div>
        <button type="submit">Add user</button>
      </form>
    </React.Fragment>
  );
};

export default addUser;
